// App.js
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="./Map" element={<Map />} />
        <Route path="/Preferences" element={<Preferences />} />
        {}
      </Routes>
    </Router>
  );
}

export default App;
